import React from "react";
import FileDropdown from "./components/Menu";
import SideBar from "./components/sidebar/SideBar";
import { Stack } from "@mui/material";
import DesignContainer from "./components/design_pane/DesignContainer";

function App() { 
  return(
    <Stack spacing={1} direction="row" style={{alignItems: 'center', marginTop: '0px' }}>
      <div style={{marginLeft: '20px', marginTop: '0px'}}>
        <FileDropdown/>
        <SideBar />
      </div>

      <div style={{ marginTop: '72px', marginLeft: '40px' }}>
        <DesignContainer />
      </div>
    </Stack>
  );
}

export default App;
